ple.  Detailed investigations found that SARS-CoV was transmitted from civet cats to humans and MERS-CoV from camels to humans. Several known coronaviruses are circulating in animals that have not yet infected humans. It is believed that COVID-19 was transmitted from pangolin to humans (current theory).\\nCommon signs of infection include respiratory symptoms, fever, cough, shortness of breath and breathing difficulties. In more severe cases, infection can cause pneumonia, severe acute respiratory syndrome, kidney failure and even death (WHO, 2020). \\nNinja Nerd Lectures has compiled the most up to date and recent data on COVID-19 as of March 15, 2020. Please follow along with this lecture to understand the origin and zoonosis of COVID-19, the routes of transmission, epidemiology (current as of 3\/15\/2020), pathophysiology, and diagnostic tests used to identify COVID-19. \\nAs new information and research is published we will continue to provide updates on COVID-19 and ensure all of our viewers are kept up to date on the most recent data. \\n\\nSUPPORT US! paypal.me\/ninjanerdscience\\n\\nREFERENCES: World Health Organization (WHO), Centers for Disease Control and Prevention (CDC).  \\n\\n\\nSupport us by purchasing apparel and donating to our PayPal or Patreon! 😄\\n\\n--Become a Patron of ours and receive the final, high resolution photo of the lecture!\\n\\nFUNDING\\n\\nGoFundMe | https:\/\/www.gofundme.com\/ninja-nerd-science\\n\\nAPPAREL |\\nAmazon Prime Free Delivery | https:\/\/www.amazon.com\/Ninja-Nerd-Science\/dp\/B07N27WLDR\/ref=sr_1_1?dchild=1\\u0026keywords=ninja+nerd+science\\u0026qid=1577670861\\u0026sr=8-1\\nTeespring | https:\/\/teespring.com\/stores\/ninja-nerd \\n\\nPATREON | https:\/\/www.patreon.com\/NinjaNerdScience\\n\\n\\nSOCIAL MEDIA\\n\\nFACEBOOK | https:\/\/www.facebook.com\/NinjaNerdScience\\n\\nINSTAGRAM | https:\/\/www.instagram.com\/ninjanerdscience\\n\\n\\nALSO, check out our Medical channel | Ninja Nerd Medicine!\\n\\nhttps:\/\/www. e common cold to more severe diseases such as Middle East Respiratory Syndrome (MERS-CoV) and Severe Acute Respiratory Syndrome (SARS-CoV). Coronavirus disease (COVID-19) caused by SARS-COV2 is a new strain that was discovered in 2019 and has not been previously identified in humans.\nCoronaviruses are zoonotic, meaning they are transmitted between animals and people.  Detailed investigations found that SARS-CoV was transmitted from civet cats to humans and MERS-CoV from camels to humans. Several known coronaviruses are circulating in animals that have not yet infected humans. It is believed that COVID-19 was transmitted from pangolin to humans (current theory).\nCommon signs of infection include respiratory symptoms, fever, cough, shortness of breath and breathing difficulties. In more severe cases, infection can cause pneumonia, severe acute respiratory syndrome, kidney failure and even death (WHO, 2020). \nNinja Nerd Lectures has compiled the most up to date and recent data on COVID-19 as of March 15, 2020. Please follow along with this lecture to understand the origin and zoonosis of COVID-19, the routes of transmission, epidemiology (current as of 3/15/2020), pathophysiology, and diagnostic tests used to identify COVID-19. \nAs new information and research is published we will continue to provide updates on COVID-19 and ensure all of our viewers are kept up to date on the most recent data. \n\nSUPPORT US! paypal.me/ninjanerdscience\n\nREFERENCES: World Health Organization (WHO), Centers for Disease Control and Prevention (CDC).  \n\n\nSupport us by purchasing apparel and donating to our PayPal or Patreon! 😄\n\n--Become a Patron of ours and receive the final, high resolution photo of the lecture!\n\nFUNDING\n\nGoFundMe | "},{"text":"https://www.gofundme.com/ninja-nerd-s...","navigationEndpoint":{"clickTrackingParams":"CKABEM2rARgCIhMIz-z0ofOc6gIVWgEGAB2y9wKMSOrHgp-r4La2PQ==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fwww.gofundme.c sed by SARS-COV2 is a new strain that was discovered in 2019 and has not been previously identified in humans.\nCoronaviruses are zoonotic, meaning they are transmitted between animals and people.  Detailed investigations found that SARS-CoV was transmitted from civet cats to humans and MERS-CoV from camels to humans. Several known coronaviruses are circulating in animals that have not yet infected humans. It is believed that COVID-19 was transmitted from pangolin to humans (current theory).\nCommon signs of infection include respiratory symptoms, fever, cough, shortness of breath and breathing difficulties. In more severe cases, infection can cause pneumonia, severe acute respiratory syndrome, kidney failure and even death (WHO, 2020). \nNinja Nerd Lectures has compiled the most up to date and recent data on COVID-19 as of March 15, 2020. Please follow along with this lecture to understand the origin and zoonosis of COVID-19, the routes of transmission, epidemiology (current as of 3/15/2020), pathophysiology, and diagnostic tests used to identify COVID-19. \nAs new information and research is published we will continue to provide updates on COVID-19 and ensure all of our viewers are kept up to date on the most recent data. \n\nSUPPORT US! paypal.me/ninjanerdscience\n\nREFERENCES: World Health Organization (WHO), Centers for Disease Control and Prevention (CDC).  \n\n\nSupport us by purchasing apparel and donating to our PayPal or Patreon! 😄\n\n--Become a Patron of ours and receive the final, high resolution photo of the lecture!\n\nFUNDING\n\nGoFundMe | https://www.gofundme.com/ninja-nerd-science\n\nAPPAREL |\nAmazon Prime Free Delivery | https://www.amazon.com/Ninja-Nerd-Science/dp/B07N27WLDR/ref=sr_1_1?dchild=1\u0026keywords=ninja+nerd+science\u0026qid=1577670861\u0026sr=8-1\nTeespring | https://teespring.com/stores/ninja-nerd \n\nPATREON | https://www.patreon.com/NinjaNerdScience\n\n\nSOCIAL MEDIA\n\nFACEBOOK | https://www.facebook.com/NinjaNerdScience\n\nINSTAG
